  `pid` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'tiktok返回的产品id',
  `name` varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'tk产品名称',
  `create_time` bigint(1) UNSIGNED NULL DEFAULT NULL COMMENT 'tk创建的时间',
  `status` tinyint(1) NULL DEFAULT NULL COMMENT 'tk产品状态',
  `maxprice` decimal(20, 2) NULL DEFAULT NULL COMMENT '最高价格',
  `minprice` decimal(20, 2) NULL DEFAULT NULL COMMENT '最低价格',
  `commission` float(4, 2) NULL DEFAULT NULL COMMENT '产品佣金比例,卖出价格的百分比',
  `commissioned` float(10, 2) NULL DEFAULT NULL COMMENT '产品共产生佣金',
  `commission_price` double(20, 2) NULL DEFAULT NULL COMMENT '佣金金额',
  `currency` varchar(8) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '货币',
  `stocks` int(1) UNSIGNED NULL DEFAULT NULL COMMENT '总库存',
  `description` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '产品详情',
  `ud` tinyint(1) UNSIGNED NULL DEFAULT 1 COMMENT '是否显示, 和tk无关',
  `images` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '图集',
  `thumbs` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '产品缩略图集',
  `brand` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '品牌',
  `sales` int(1) UNSIGNED NULL DEFAULT 0 COMMENT '销量,件',
  `gmv` decimal(14, 2) NULL DEFAULT 0.00 COMMENT '销售额',
  `resion` char(2) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '销售地区',
  `tips` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '带货说明',
  `fans` int(1) UNSIGNED NULL DEFAULT 1000 COMMENT '粉丝要求',
  `zans` bigint(1) UNSIGNED NULL DEFAULT 100 COMMENT '点赞数要求',
  `selling_point` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '卖点',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `aid`(`aid`) USING BTREE,
  INDEX `account_id`(`account_id`) USING BTREE,
  INDEX `shop_id`(`shop_id`) USING BTREE,
  INDEX `pid`(`pid`) USING BTREE,
  INDEX `search`(`name`, `status`) USING BTREE,
  INDEX `searchprice`(`maxprice`, `minprice`) USING BTREE,
  INDEX `commission`(`commission`) USING BTREE,
  INDEX `ud`(`ud`) USING BTREE,
  INDEX `brand`(`brand`) USING BTREE,
  INDEX `commission_price`(`commission_price`) USING BTREE,
  INDEX `resion`(`resion`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1129 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

