-- ----------------------------
-- Table structure for tiktok_samples
-- ----------------------------
DROP TABLE IF EXISTS `tiktok_samples`;
CREATE TABLE `tiktok_samples`  (
  `id` int(1) UNSIGNED NOT NULL AUTO_INCREMENT,
  `account_id` int(1) UNSIGNED NOT NULL COMMENT 'ucenter-user 表的id',
  `darren_id` int(1) UNSIGNED NOT NULL COMMENT 'tiktok账号id',
  `pid` int(1) UNSIGNED NOT NULL COMMENT 'tiktok_products表id',
  `product_id` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'tiktok方的产品id',
  `product_name` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'tiktok_products name字段',
  `product_image` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'tiktok_products images字段',
  `addtime` int(1) UNSIGNED NOT NULL COMMENT '申请时间',
  `admin_id` int(1) UNSIGNED NULL DEFAULT NULL COMMENT '后台操作人员',
  `num` smallint(1) UNSIGNED NULL DEFAULT 1 COMMENT '申请数量',
  `remark` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '领样备注',
  `needtime` int(1) UNSIGNED NULL DEFAULT NULL COMMENT '最迟需要的时间',
  `status` tinyint(1) NULL DEFAULT 0 COMMENT '领样状态 0-待审核  1-审核通过寄样中 2-已发货 3-已收货 -1-拒绝 -2-用户取消',
  `rejection` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '拒绝理由',
  `shippment` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '快递公司',
  `shipnum` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '快递单号',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `account_id`(`account_id`) USING BTREE,
  INDEX `darren_id`(`darren_id`) USING BTREE,
  INDEX `pid`(`pid`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

